//  SKINNED FROM JSON.
//  skinnedfromJSON.js (v1.7)

function skinnedfromJSON( json ){

/*body*/
	var scale = json.scale;
	var visible = json.visible;

	//	geometry.

	var data;

	switch ( typeof( json.geometry ) ) {
		case "string":
			if ( validator && validator.isJSON( json.geometry ) ) {
				data = JSON.parse( json.geometry );
				break;
			}
		break;

		case "object":
			data = json.geometry;
		break;
	}

//	debugMode && console.log({"data": data});

	if ( data === undefined ) return;

	var loader = new THREE.JSONLoader();
	var geometry = loader.parse(data).geometry;

	geometry.name = data.name;
	geometry.computeFaceNormals();
	geometry.computeVertexNormals();
	geometry.computeBoundingBox();
	geometry.computeBoundingSphere();
	geometry.sourceType = "ascii";
	geometry.sourceFile = json.geometry;

//	debugMode && console.log({"geometry": geometry});

	//	material.

	var material = materialfromJSON( json.material );

	if ( material === undefined ) {
		material = new THREE.MeshStandardMaterial({skinning:true});
	}

//	debugMode && console.log({"material": material});

	//	skinned.

	var skinned = new THREE.SkinnedMesh( geometry, material );

	if ( skinned === undefined ) return;

	skinned.renderDepth = 1;
	skinned.frustumCulled = false;
	skinned.position.set( 0, 0, 0 );
	skinned.rotation.set( 0, 0, 0 );
	skinned.scale.fromArray( scale );
	skinned.visible = visible;

//	debugMode && console.log({"skinned": skinned});

	return skinned;
/*body*/

}


//  blobToDataUrl.js
//  https://gist.github.com/tantaman/6921973
//	https://hacks.mozilla.org/2012/02/storing-images-and-files-in-indexeddb/

function convertToBase64(blob, callback) {

/*body*/
	var reader = new FileReader();

	reader.onload = function(e) {
		callback(reader.result);
	};

	reader.readAsDataURL(blob);
/*body*/

}



//  dataUrlToBlob.js
//  https://gist.github.com/tantaman/6921973

function dataURLToBlob(dataURL) {

/*body*/
	var BASE64_MARKER = ";base64,";

	if (dataURL.indexOf(BASE64_MARKER) == -1) {
		var parts = dataURL.split(",");
		var contentType = parts[0].split(":")[1];
		var raw = parts[1];

		return new Blob([raw], {type: contentType});
	}

	var parts = dataURL.split(BASE64_MARKER);
	var contentType = parts[0].split(":")[1];
	var raw = window.atob(parts[1]);
	var rawLength = raw.length;

	var uInt8Array = new Uint8Array(rawLength);

	for (var i = 0; i < rawLength; ++i) {
		uInt8Array[i] = raw.charCodeAt(i);
	}

	return new Blob([uInt8Array], {type: contentType});
/*body*/

}



//  makePowerOfTwo.js

function makePowerOfTwo( image, natural ) {

/*body*/
	var canvas = document.createElement( "canvas" );

	if ( natural ){
		canvas.width = THREE.Math.nearestPowerOfTwo( image.naturalWidth );
		canvas.height = THREE.Math.nearestPowerOfTwo( image.naturalHeight );
	} else {
		canvas.width = THREE.Math.nearestPowerOfTwo( image.width );
		canvas.height = THREE.Math.nearestPowerOfTwo( image.height );
	}

	var context = canvas.getContext( "2d" );
	context.drawImage( image, 0, 0, canvas.width, canvas.height );

//  debugMode && console.warn( "outfitLoader:makePowerOfTwo(img):", 
//  "Image resized to:", canvas.width, "x", canvas.height );

	return canvas;
/*body*/

}




//  deepCopy.js

function deepCopy(obj) {

/*body*/
	if (Object.prototype.toString.call(obj) === "[object Array]") {
		var out = [], i = 0, len = obj.length;
		for ( ; i < len; i++ ) {
			out[i] = arguments.callee(obj[i]);
		}
		return out;
	}
	if (typeof obj === "object") {
		var out = {}, i;
		for ( i in obj ) {
			out[i] = arguments.callee(obj[i]);
		}
		return out;
	}
	return obj;
/*body*/

}


//  round.js  "https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Math/round"

function round(number, precision) {

/*body*/
	var shift = function (number, precision, reverseShift) {
		if (reverseShift) {
			precision = -precision;
		}  
		numArray = ("" + number).split("e");
		return +(numArray[0] + "e" + (numArray[1] ? (+numArray[1] + precision) : precision));
	};
	return shift(Math.round(shift(number, precision, false)), precision, true);
/*body*/

}


//	Move array item from one position to another position.
//	https://stackoverflow.com/questions/5306680/move-an-array-element-from-one-array-position-to-another.

function array_move( array, from_index, to_index ) {

	if (to_index >= array.length) {
		var k = to_index - array.length + 1;
		while (k--) {
			array.push(undefined);
		}
	}

	array.splice(to_index, 0, array.splice(from_index, 1)[0]);

	debugMode && console.log( array );
}

