function loadfromCache( url ){

	var name = "textures";

	return caches.match( url ).then(function( response ){

		if ( !response ) 
			return addtoCache(url);
		else
			return response.blob();

	}).then(function( blob ){

		return URL.createObjectURL( blob );

	}).then(function( objectURL ){

		var loader = new THREE.TextureLoader();
		loader.setCrossOrigin(""); // important!
		return loader.load( objectURL, function( texture ){
			texture.sourceFile = url;
			texture.wrapS = texture.wrapT = 1000; // RepeatWrapping.
			texture.needsUpdate = true; // important!
			Textures && texture && texture.image && Textures.push( texture );
		});

	}).catch(function( err ){
		console.error( err );

		var loader = new THREE.TextureLoader();
		loader.setCrossOrigin(""); // important!
		return loader.load( url, function( texture ){
			texture.sourceFile = url;
			texture.wrapS = texture.wrapT = 1000; // RepeatWrapping.
			texture.needsUpdate = true; // important!
			Textures && texture && texture.image && Textures.push( texture );
		});

	});

	function addtoCache( url ){
		return caches.open( name ).then(function( cache ){
			return cache.add( url ).then(function(){
				return cache.match( url ).then(function( response ){
					return response.blob();
				});
			});
		});
	}

}

