});

mesh = new THREE.Mesh( geometry, material );

var Signal = signals.Signal;
materialSelected = new Signal();
materialSelected.add(function( material ){

//	"false" will stop propagation.
	if ( !material ) return false;

});

materialSelected.add(function(){

//	Dispose old material.
	disposeMaterial( mesh );

});

materialSelected.add(function( material ){

//	Apply selected material.
