function MaterialViewer( mesh ){

	var container = document.createElement("div");
	container.style.cssText = "width:fit-content;height:fit-content;max-width:300px;"
		+ "max-height:300px;margin:20px auto;border:1px solid;overflow:hidden;";

	var scene = new THREE.Scene();
	var camera = new THREE.PerspectiveCamera( 75, 1, 0.1, 50 );
	camera.position.z = 25;

	var ambientLight = new THREE.AmbientLight( 0x000000 );
	var controls = new THREE.EditorControls( camera, container );

	var lights = [];
	lights[ 0 ] = new THREE.PointLight( 0xffffff, 1, 0 );
	lights[ 1 ] = new THREE.PointLight( 0xffffff, 1, 0 );
	lights[ 2 ] = new THREE.PointLight( 0xffffff, 1, 0 );

	lights[ 0 ].position.set( 0, 200, 0 );
	lights[ 1 ].position.set( 100, 200, 100 );
	lights[ 2 ].position.set( -100, -200, -100 );

	scene.add( lights[ 0 ] );
	scene.add( lights[ 1 ] );
	scene.add( lights[ 2 ] );
	scene.add( ambientLight );

	scene.add( mesh );

	var renderer = new THREE.WebGLRenderer( { antialias: true } );
	renderer.setPixelRatio( 1 );
	renderer.setSize( 256, 256 );
	container.appendChild( renderer.domElement );

	(function render() {

		requestAnimationFrame( render );

		var time = Date.now() * 0.001;

		mesh.rotation.x += 0.005;
		mesh.rotation.y += 0.005;

		renderer.render( scene, camera );

	})();

	return container;

}

function disposeMaterial( mesh ){

	var material = mesh.material;

	if ( material && material.materials && material.materials.length ) {

		for ( var i = 0; i < material.materials.length; i++ ) {
			material.materials[i] && dispose( material.materials[i] );
		}

	} else {

		material && !material.materials && dispose( material );

	}

}

function dispose( material ){

	material && material.map && material.map.dispose && material.map.dispose();
	material && material.bumpMap && material.bumpMap.dispose && material.bumpMap.dispose();
	material && material.alphaMap && material.alphaMap.dispose && material.alphaMap.dispose();
	material && material.normalMap && material.normalMap.dispose && material.normalMap.dispose();
	material && material.emissiveMap && material.emissiveMap.dispose && material.emissiveMap.dispose();
	material && material.roughnessMap && material.roughnessMap.dispose && material.roughnessMap.dispose();
	material && material.metalnessMap && material.metalnessMap.dispose && material.metalnessMap.dispose();
	material && material.displacementMap && material.displacementMap.dispose && material.displacementMap.dispose();
	material && material.lightMap && material.lightMap.dispose && material.lightMap.dispose();
	material && material.envMap && material.envMap.dispose && material.envMap.dispose();
	material && material.aoMap && material.aoMap.dispose && material.aoMap.dispose();
	material && material.dispose && material.dispose();

}

setTimeout(function(){

	var tab = document.getElementById("materials-tab");

	var header = document.createElement("h3");
	header.textContent = "Select from Materials:";
	header.style.cssText = "text-align:center;";
	tab.appendChild( header );
	tab.appendChild( new SelectMaterial() );

});

function SelectMaterial(){

	var interval;

	var row = document.createElement("div");
	row.style.cssText = "margin:10px 10px;height:35px;text-align:center;";

	var prev = document.createElement("li");
	prev.innerHTML = "&#9668;";
	prev.style.display = "inline";
	prev.classList.add("btn","btn-primary","get-prev-btn","pull-left");

	var next = document.createElement("li");
	next.innerHTML = "&#9658;";
	next.style.display = "inline";
	next.classList.add("btn","btn-primary","get-next-btn","pull-right");

	var input = document.createElement("input");

	input.id = "material-select-ui";
	input.type = "text";
	input.style.color = "#fff";
	input.style.border = "none";
	input.style.display = "inline";
	input.style.maxWidth = "65%";
	input.style.fontSize = "large";
	input.style.fontWeight = "bold";
	input.style.background = "none";
	input.style.textOverflow = "ellipsis";
	input.setAttribute("disabled", true);
	input.setAttribute("placeholder", "no material" );
	input.classList.add("form-control","text-center","material-input");

	var index = 0; // important!
	var values = Materials.map(function( material ){
		return material.name;
	});

	input.getIndex = function(){
		return index;
	};

	input.updateValues = function(){
		values = Materials.map(function( material ){
			return (material && material.name) || (material && material.uuid) || "";
		});
	};

	input.reset = function (){
		index = 0;
		input.updateValues();
		input.value = values[ index ];
	};

	input.update = function(){

	//	Update values.
		input.updateValues();

	//	Update value.
		input.value = values[ index ];

	//	Update viewer.
		materialSelected.dispatch( Materials[ index ] );

	};

	input.decrease = function(){

		var max = values.length - 1;

		if ( index < 1 ) 
			index = max;
		else
			index -= 1;

		input.value = values[ index ];
	};

	input.increase = function(){

		var limit = values.length - 2;

		if ( index > limit ) 
			index = 0;
		else
			index += 1;

		input.value = values[ index ];
	};

//	Event handlers.

	prev.addEventListener("click", descendHandler);
	next.addEventListener("click", increaseHandler);

	function descendHandler(){
		clearTimeout( interval );
		input.decrease();
		interval = setTimeout( input.update, 250 );

	}

	function increaseHandler(){
		clearTimeout( interval );
		input.increase();
		interval = setTimeout( input.update, 250 );

	}

	row.appendChild(prev);
	row.appendChild(input);
	row.appendChild(next);

	input.update();

	return row;

}

