scene.remove( this );

Geometries = [];	// array with json geometry items.

//	Returns "Geometries" stringified.

function toJSON(){
	return JSON.stringify( Geometries );
}

//	Creates an array of geometries json items.

function fromJSON( data ){
	if ( validator.isJSON( data ) ) {
		Geometries = JSON.parse( data );
	}
}

//	Returns a skinned mesh from "Geometries" item.

function skinnedfromGeometry( json ){

	if ( json === undefined ) return;

	var loader = new THREE.JSONLoader();
	var object = loader.parse(json);
	if ( object.geometry === undefined ) return;

	var geometry;

	geometry = object.geometry;
	geometry.name = json.name;
	geometry.computeFaceNormals();
	geometry.computeVertexNormals();
	geometry.computeBoundingBox();
	geometry.computeBoundingSphere();
	geometry.sourceType = "ascii";
	geometry.sourceFile = JSON.stringify( json );
//	debugMode && console.log({"geometry": geometry});

	for ( var i = 0; i < object.materials.length; i++ ){
		object.materials[i].skinning = true;
	}

	var material;

	if ( object.materials.length == 1 ) {
		material = object.materials[0];
	} else if ( object.materials.length > 1 ) {
		material = new THREE.MeshFaceMaterial(object.materials);
	} else {
		material = new THREE.MeshStandardMaterial({skinning:true});
	}

	if ( material === undefined ) return;
//	debugMode && console.log({"material": material});

	var skinned;

	skinned = new THREE.SkinnedMesh( geometry, material );
	if ( skinned === undefined ) return;

	skinned.renderDepth = 1;
	skinned.frustumCulled = false;
	skinned.position.set( 0, 0, 0 );
	skinned.rotation.set( 0, 0, 0 );
	skinned.scale.set( 1, 1, 1 );
	skinned.visible = true;

//	debugMode && console.log({"skinned": skinned});

	return skinned;

}

